webpackJsonp([229],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-what-is-the-net-framework.json":function(e,a){e.exports={data:{markdownRemark:{html:'<p><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/7/7068b1111104197f2692a98aec00f388e09e9ab5.png" alt=".NET Logo"></p>\n<p><a href="https://www.microsoft.com/net">.NET Framework</a> or simply, .NET is a multi-purpose multi-language runtime framework; created and owned by <a href="https://www.microsoft.com">Microsoft</a>.</p>\n<p>It has a large class library, supports language interpolability; and runs primarily on Windows.</p>\n<p>Microsoft started development of .NET Framework in the late 1990s, and by 2000s; a beta version was released. Other than Windows GUI development and Windows Phone apps development; the .NET framework is used in web development.</p>\n<p>It works seamlessly with <a href="https://azure.microsoft.com/en-us/">Microsoft Azure</a> cloud hosting platform and <a href="https://www.microsoft.com/en-us/server-cloud/products/sql-server/">SQL Server</a> database. It allows programming the server side in multiple different languages; predominantly in <a href="https://msdn.microsoft.com/en-us/library/67ef8sbd.aspx">C#</a>.</p>\n<p>With <a href="https://msdn.microsoft.com/en-us/default.aspx">MSDN</a> as a content-rich community, there are lots of potentials and benefits to using .NET for web development.</p>',frontmatter:{title:"What Is the Net Framework",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/what-is-the-net-framework/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/what-is-the-net-framework/"}}}});
